// Implementation with HEX[3:0] as just unsigned int
void display_hex(int num){
    int digit_0 = 0;
    int digit_1 = 0;
    int digit_2 = 0;
    int digit_3 = 0;

    digit_0 = hex_decode(num % 10);

    // iteration 1
    num = num / 10;
    if(num != 0) digit_1 = hex_decode(num % 10);

    num = num / 10;
    if(num != 0) digit_2 = hex_decode(num % 10);

    num = num / 10;
    if(num != 0) digit_3 = hex_decode(num % 10);

    *HEXs = (digit_0 | (digit_1 << 8) | (digit_2 << 16) | (digit_3 << 24));
}

int hex_decode(int num){
    int decoded = 0;
    switch (num) {
        case 0: decoded = HEX_0;
        break;
        case 1: decoded = HEX_1;
        break;
        case 2: decoded = HEX_2;
        break;
        case 3: decoded = HEX_3;
        break;
        case 4: decoded = HEX_4;
        break;
        case 5: decoded = HEX_5;
        break;
        case 6: decoded = HEX_6;
        break;
        case 7: decoded = HEX_7;
        break;
        case 8: decoded = HEX_8;
        break;
        case 9: decoded = HEX_9;
        break;
        default: decoded = 0;
    }
    return decoded;
}


